export default function Widgets(){
    return (
        <div className = "widgets">
            <iframe src="https://www.instagram.com/ossaaaamaa/" width="340" height="100%" style={{border:"none",overflow:"hidden"}} scrolling="no" frameborder="0" allowfullscreen="true" allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share"></iframe>
        </div>
    );
}
